import React from "react";
import "./Navbar.module.scss"
//import pepe from "./Navbar.module.scss"



{/*
<p className={`${pepe.prueba} d-flex flex-sm-row flex-column align-items-center justify-content-center gap-4 mb-5`}>
    Navbar
</p>
*/}

const Navbar = () => {
    return (
        <>
           <nav className="navbar navbar-expand-lg fixed-top navbar-govco navbar-light">
            <div className="container">
                <a className="navbar-brand" href="https://www.gov.co/">
                    <img src="https://cdn.www.gov.co/assets/images/logo.png" alt="Logo Gov.co" height="30" />
                </a>
            </div>
           </nav> 
        </>
    );
}

export default Navbar;
